Δεδομένου ότι Την Τρίτη, ο Μπους προειδοποίησε, Πολύ συχνά, σε κοινωνικά θέματα, το κόμμα μου έχει ζωγραφίσει μια εικόνα της Αμερικής που γέρνει προς τη Γόμορρα. προκύπτει ότι Ο Μπους προειδοποίησε μια μέρα ότι το κόμμα του συχνά υπερέβαλε στην εικόνα κοινωνικών ζητημάτων. Ναι, όχι, ή ίσως;
Ναί

Δεδομένου ότι Αυτό ήταν στο Bridgetown τη νύχτα της ισπανικής επιδρομής. προκύπτει ότι Ποτέ δεν υπήρξε έφοδος στο Bridgetown. Ναι, όχι, ή ίσως;
Οχι

Δεδομένου ότι Είναι μία έντιμη υπηρεσία. προκύπτει ότι Δεν είναι καθόλου αξιέπαινη υπηρεσία, είναι πολύ ντροπιαστική! Ναι, όχι, ή ίσως;
Οχι

Δεδομένου ότι Λοιπόν, δεν το σκέφτηκα καν, αλλά ήμουν τόσο απογοητευμένος, και κατέληξα να του μιλάω και πάλι. προκύπτει ότι Δεν του μίλησα ξανά. Ναι, όχι, ή ίσως;
